sys_variable_value.value:
(function execute(inputs, outputs) {

  var statusCode = inputs.StatusCode;
  var message = "";

  if(statusCode == 403 || statusCode == 404){
  	message = "ID do projeto não foi encontrado";
  }else if(statusCode == 400){
    message = "A solicitação que foi enviada estava de alguma forma incorreta";
  }else if(statusCode == 502){
    message = "Houve uma falha na comunicação entre o servidor";
  }

  outputs.message = message;
})(inputs, outputs);

