sys_variable_value.value:
(function execute(inputs, outputs) {

  var request = {};
  var projeto = "";
  var centro_de_custo = "";
  var project_name = "";
  var owner_email = "";
  var technical_manager = "";
  var manager_ar = "";//
  var owners_team = "";
  var workstrin = "";
  var iniciativa = "";

//check_box_gestor_responsavel 
//check_box_atividade *
//check_box_responsavel_tecnico *
//check_box_nome_conta *
//check_box_ar *
//check_box_email_group 

var grScTask = new GlideRecord('sc_task');
if(grScTask.get(inputs.currentcatalogtask)){
    if(grScTask.variables['check_box_projeto'] == 'true'){
      projeto = grScTask.variables['editar_projeto'].value.getDisplayValue().toString();
      request["projeto-activity"] = projeto;
        //gs.print("Check bod de atividade: " + grScTask.variables['editar_atividade']);
    }
    if (grScTask.variables['check_box_responsavel_tecnico'] == 'true') {
      owner_email = grScTask.variables['name_technical_manager_edit'].email.getDisplayValue().toString();
      request.owner_email = owner_email;
        //gs.print("check_box_responsavel_tecnico: " + grScTask.variables['name_technical_manager_edit']);
    }
    if (grScTask.variables['check_box_centro_de_custo'] == 'true') {
      centro_de_custo = grScTask.variables['editar_centro_de_custo'].code.getDisplayValue().toString();
      request.cc = centro_de_custo;
    }
  	//flata altarar no formulario e criar variable
  	if (grScTask.variables['check_box_nome_conta'] == 'true') {
      project_name = grScTask.variables['editar_nome_da_conta'].toString();
      request.project_name = project_name;
    }
  	if (grScTask.variables['check_box_gestor_responsavel'] == 'true') {
      manager_ar = grScTask.variables['editar_gestor_responsvel'].getDisplayValue().toString();
      request.manager_ar = manager_ar;
    }
  	if (grScTask.variables['check_box_email_group'] == 'true') {
      owners_team = grScTask.variables['email_edit_group'].toString();
      request.owners_team = owners_team;
    }
  	if(grScTask.variables['check_box_workstream_e_iniciativa'] == 'true'){
      if(grScTask.variables['editar_workstream_e_iniciativa'] == "CDN Internacional"){
      iniciativa = grScTask.variables['editar_iniciativa_cdn_internacional'].toString();
      }else if(grScTask.variables['editar_workstream_e_iniciativa'] == 'Digital Migration'){
      iniciativa = grScTask.variables['editar_iniciativa_digital_migration'].toString();  
      }else if(grScTask.variables['editar_workstream_e_iniciativa'] == 'Media Supply Chain'){
       iniciativa = grScTask.variables['editar_iniciativa_media_supply_chain'].toString();  
      }else if(grScTask.variables['editar_workstream_e_iniciativa'] == 'Data Hub'){
       iniciativa = grScTask.variables['editar_iniciativa_data_hub'].toString();
      }else if(grScTask.variables['editar_workstream_e_iniciativa'] == 'POD Relicario'){
        iniciativa = grScTask.variables['editar_iniciativa_pod_relicario'].toString();  
      }else if(grScTask.variables['editar_workstream_e_iniciativa'] == 'Extra BC'){
        iniciativa = grScTask.variables['editar_iniciativa_extra_bc'].toString();
      }
      workstrin = grScTask.variables['editar_workstream_e_iniciativa'].toString();
      request.workstream = {name:workstrin,iniciativa:iniciativa};
    }

}

  /*gs.info("Eeeeita preula: " + inputs.currentcatalogtask);
   gs.debug("Eeeeita preula, olha só passei no 1° IF");
   activity = inputs.catalogtask.parent.variables.editar_atividade.getDisplayValue();
   activity = activity.toString();
   request.activity = activity;
   gs.debug("Eeeeita preula, olha só passei no 1° ELSEIF");
   owner_email = inputs.currentcatalogtask.parent.name_technical_manager_edit;
   owner_email = owner_email.toString();
   request.owner_email = owner_email;
 /*if(inputs.currentcatalogtask.variables.check_box_atividade == true){

 }else if(inputs.currentcatalogtask.variables.check_box_responsavel_tecnico == true){

 }*/


  var jsonString = JSON.stringify(request);
  gs.info("Eeeeita preula, olha só: " + JSON.stringify(jsonString));

  outputs.task2 = jsonString.toString();


})(inputs, outputs);

